class PHPzip{

	var $file_count = 0 ;
	var $datastr_len   = 0;
	var $dirstr_len = 0;
	var $filedata = ''; //\xe8\xaf\xa5\xe5\x8f\x98\xe9\x87\x8f\xe5\x8f\xaa\xe8\xa2\xab\xe7\xb1\xbb\xe5\xa4\x96\xe9\x83\xa8\xe7\xa8\x8b\xe5\xba\x8f\xe8\xae\xbf\xe9\x97\xae
	var $gzfilename;
	var $fp;
	var $dirstr='';
	/*
	\xe8\xbf\x94\xe5\x9b\x9e\xe6\x96\x87\xe4\xbb\xb6\xe7\x9a\x84\xe4\xbf\xae\xe6\x94\xb9\xe6\x97\xb6\xe9\x97\xb4\xe6\xa0\xbc\xe5\xbc\x8f.
	\xe5\x8f\xaa\xe4\xb8\xba\xe6\x9c\xac\xe7\xb1\xbb\xe5\x86\x85\xe9\x83\xa8\xe5\x87\xbd\xe6\x95\xb0\xe8\xb0\x83\xe7\x94\xa8.
	*/
    function unix2DosTime($unixtime = 0) {
        $timearray = ($unixtime == 0) ? getdate() : getdate($unixtime);

        if ($timearray['year'] < 1980) {
        	$timearray['year']    = 1980;
        	$timearray['mon']     = 1;
        	$timearray['mday']    = 1;
        	$timearray['hours']   = 0;
        	$timearray['minutes'] = 0;
        	$timearray['seconds'] = 0;
        }

        return (($timearray['year'] - 1980) << 25) | ($timearray['mon'] << 21) | ($timearray['mday'] << 16) |
               ($timearray['hours'] << 11) | ($timearray['minutes'] << 5) | ($timearray['seconds'] >> 1);
    }

	function startfile($path = 'phpinfo.zip'){
		$this->gzfilename=$path;
		$mypathdir=array();
		do{
			$mypathdir[] = $path = dirname($path);
		}while($path != '.');
		@end($mypathdir);
		do{
			$path = @current($mypathdir);
			@mkdir($path);
		}while(@prev($mypathdir));

		if($this->fp=@fopen($this->gzfilename,"w")){
			return true;
		}
		return false;
	}

    function addfile($data, $name){
        $name     = str_replace('\\', '/', $name);
		
		if(strrchr($name,'/')=='/') return $this->adddir($name);
		
        $dtime    = dechex($this->unix2DosTime());
        $hexdtime = '\x' . $dtime[6] . $dtime[7]
                  . '\x' . $dtime[4] . $dtime[5]
                  . '\x' . $dtime[2] . $dtime[3]
                  . '\x' . $dtime[0] . $dtime[1];
        eval('$hexdtime = "' . $hexdtime . '";');

        $unc_len = strlen($data);
        $crc     = crc32($data);
        $zdata   = gzcompress($data);
        $c_len   = strlen($zdata);
        $zdata   = substr(substr($zdata, 0, strlen($zdata) - 4), 2);
		
        $datastr  = "\x50\x4b\x03\x04";
        $datastr .= "\x14\x00"; 
        $datastr .= "\x00\x00";
        $datastr .= "\x08\x00"; 
        $datastr .= $hexdtime; 
        $datastr .= pack('V', $crc);
        $datastr .= pack('V', $c_len);
        $datastr .= pack('V', $unc_len);
        $datastr .= pack('v', strlen($name));
        $datastr .= pack('v', 0); 
        $datastr .= $name;
        $datastr .= $zdata;
        $datastr .= pack('V', $crc); 
        $datastr .= pack('V', $c_len);
        $datastr .= pack('V', $unc_len);


		fwrite($this->fp,$datastr);
		$my_datastr_len = strlen($datastr);
		unset($datastr);
		
        $dirstr  = "\x50\x4b\x01\x02";
        $dirstr .= "\x00\x00"; 
        $dirstr .= "\x14\x00";
        $dirstr .= "\x00\x00";
        $dirstr .= "\x08\x00";
        $dirstr .= $hexdtime;
        $dirstr .= pack('V', $crc); 
        $dirstr .= pack('V', $c_len); 
        $dirstr .= pack('V', $unc_len);       	// uncompressed file"]]}
